import React from "react";
import { FaFacebookF, FaTwitter, FaInstagram } from "react-icons/fa";
import "../styles/Home.css";
import MatchaDrink from "../assets/matcha-drink.png";
import Logo1 from "../assets/logo1.png";
import Logo2 from "../assets/logo2.png";

const StarbucksClone = () => {
  return (
    <div className="container">
      <div className="card">
        <div className="text-section">
          <h1 className="title">Summer Time Drinks</h1>
          <p className="description">
            Flavorful creations sure to brighten any summer day. Enjoy a powerful
            boost of energy handcrafted with sparkling fruit flavors. Try it
            frozen with a swirl of creamy sweetness.
          </p>
          <button className="learn-more">Order Now</button>
        </div>

        <div className="image-section">
          <img src="/matcha-drink.png" alt="Green Drink" className="drink-image" />
        </div>

        <div className="small-images">
          <img src={Logo1} alt="Drink 1" className="small-image" />
          <img src={Logo2} alt="Drink 2" />
        </div>

        <div className="social-icons">
          <a href="#" className="social-icon"><FaFacebookF /></a>
          <a href="#" className="social-icon"><FaTwitter /></a>
          <a href="#" className="social-icon"><FaInstagram /></a>
        </div>
      </div>
    </div>
  );
};

export default StarbucksClone;
